import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        Scanner sc = new Scanner(System.in);
        int nGifts = sc.nextInt();
        int nPapers = sc.nextInt();
        int[] giftSizes = new int[nGifts];
        int[] paperSizes = new int[nPapers];
        for (int i = 0; i < giftSizes.length; i++) {
            giftSizes[i] = sc.nextInt();
        }
        for (int i = 0; i < paperSizes.length; i++) {
            paperSizes[i] = sc.nextInt();
        }
        Arrays.sort(giftSizes);
        Arrays.sort(paperSizes);
        int count = 0;
        int i = 0;
        int j = 0;
        while (i < giftSizes.length && j < paperSizes.length) {
            double gift = (double) giftSizes[i];
            double paper = (double) paperSizes[j];
            double temp = paper / gift;
            if (temp >= 2d && temp <= 3d) {
                count++;
                i++;
                j++;
            } else if (temp < 2) {
                j++;
            } else if (temp > 3) {
                i++;
            }
        }
        System.out.println(count);
    }
}
